import '../pages/agregar_establecimiento-page/agregar_establecimiento.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useHistory   } from 'react-router-dom';
import $ from 'jquery';
import { useEffect , useState} from "react";

export function Form_edit_establecimiento() {

  let hasDecimal = false;
  const history = useHistory();
  const [establecimientoID, setEstablecimientoID] = useState(location.pathname.split('/')[2]);
  const [gotInfo, setGotInfo] = useState(false);

  async function submitHandler(e) {
    e.preventDefault();

    const name = $('#name').val();
    const address = $('#address').val();
    const parkinglot = $('#parkinglot').val();
    const hourPrice = $('#hourPrice').val();

    if ( name === '' | address === '' |  parkinglot === '' | hourPrice === '') {
      alert('Favor de rellenar los campos faltantes');
    } else if (parkinglot < 100) {
      alert('tiene que haber mas de 100 espacios de estacionamiento');
    } else {
      const body = {
        isActive: true,
        name: name,
        address: address,
        parkinglot: parkinglot,
        hourPrice: hourPrice,
      };
      console.log(body);
      const response = await fetch(
        `http://localhost:3001/api/establecimientos`,
        {
          method: 'POST',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify(body),
        }
      );
      const respJson = await response.json();
      console.log(respJson);
      history.push("/");
    }
  }

  const onlyNumber = (event) => {
    if (!/[0-9]/.test(event.key)) {
      event.preventDefault();
    }
  };

  const onlyNumberFloat = (event) => {
    const hourPrice = $('#hourPrice').val();
    if (/\.+/.test(hourPrice)) {
      hasDecimal = true;
    } else {
      hasDecimal = false;
    }
    if (/[0-9]\.[0-9][0-9]$/.test(hourPrice)) {
      event.preventDefault();
    }
    if (/(\.)/.test(event.key) && !hasDecimal) {
      return;
    } else if (!/[0-9]/.test(event.key)) {
      event.preventDefault();
    }
  };

  useEffect(() => {

    async function getEstablecimiento() {
      if (!gotInfo) {

        const response = await fetch(`http://localhost:3001/api/v1/user/${establecimientoID}`);

        const respJson = await response.json();

        if (respJson.success) {

          if (userSessionID === userProfileID) {
            setIsMine(true)
          }
          console.log('friendForEach start')

          respJson.Data.friends.forEach(friend => {
            console.log('result', friend.user === userSessionID)

            if (friend.user === userSessionID)
              setIsFriends(true);
          })
          setUserID(userSessionID);
          setProfileImage(respJson.Data.profilePic);
          setName(respJson.Data.name);
          setDescription(respJson.Data.description);
          setbackgroundPic(respJson.Data.backgroundImg);
          setCountry(respJson.Data.countryID);
          setAge(respJson.Data.age);
          setGames(respJson.Data.favoriteGames);
          setFriends(respJson.Data.friends);
          setState(true);
        }

        setGotInfo(true);

      }

    }
    getEstablecimiento();

  }, [])




  return (
    <>
      <form onSubmit={submitHandler}>
        <label>Nombre del establecimiento </label>
        <br></br>
        <input
          type="text"
          id="name"
          placeholder="Establecimiento los cuates"
        ></input>
        <br></br>
        <label>Direccion </label>
        <br></br>
        <input
          type="text"
          id="address"
          placeholder=" Agustin de iturbide #1500 A "
        ></input>
        <br></br>
        <label>Numero de cajones </label>
        <br></br>
        <input
          type="text"
          id="parkinglot"
          placeholder="200"
          onKeyPress={onlyNumber}
        ></input>
        <br></br>
        <label>Precio por hora</label>
        <br></br>
        <input
          type="text"
          id="hourPrice"
          placeholder="200"
          onKeyPress={onlyNumberFloat}
        ></input>
        <br></br>
        <div className="btnCenter">
          <input type="submit" value="Crear establecimiento"></input>
        </div>
      </form>
    </>
  );
}
